script: |
  super -f text -I q7159.spq | sort > q7159.out

inputs:
  - name: q7159.spq
    data: |
      SELECT 73 AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE + col2 * - col0 * 33 + - ( 86 ) NOT BETWEEN - col1 - col1 * col2 AND - col2 / col1;
  - name: tab0

outputs:
  - name: q7159.out
    data: |
      73
      73
      73
